    class BoundaryMatchArrays {

       public:
         typedef enum { kTight=0, kLoose } MatchMode_t;
         typedef enum { kTop=0, kBottom, kUpstream, kDownstream } Boundary_t;

         BoundaryMatchArrays( MatchMode_t mode);
         virtual ~BoundaryMatchArrays() {};
	 
	 MatchMode_t fMode;

         int nmatches(Boundary_t b) { 
             if ( fMode==kTight ) {
               switch (b) {
                 case kTop:
                   return numTopMatches_tight;
                   break;
                 case kBottom:
                   return numBottomMatches_tight;
                   break;
                 case kUpstream:
                   return numUpstreamMatches_tight;
                   break;
                 case kDownstream:
                   return numDownstreamMatches_tight;
                   break;
                 default:
                   return 0;
                   break;
                };
              }
              else if ( fMode==kLoose ) {
                switch (b) {
                 case kTop:
                   return numTopMatches_loose;
                   break;
                 case kBottom:
                   return numBottomMatches_loose;
                   break;
                 case kUpstream:
                   return numUpstreamMatches_loose;
                   break;
                 case kDownstream:
                   return numDownstreamMatches_loose;
                   break;
                 default:
                   return 0;
                   break;
                };
              }
	     return -1;
           };

          void getMatch( Boundary_t b, int imatch, int& uwire, int& vwire, int& ywire ) {
             if ( fMode==kTight ) {
               switch (b) {
                 case kTop:
                   uwire =  top_matches_tight[imatch][0];
                   vwire =  top_matches_tight[imatch][1];
                   ywire =  top_matches_tight[imatch][2];
                   break;
                 case kBottom:
                   uwire =  bottom_matches_tight[imatch][0];
                   vwire =  bottom_matches_tight[imatch][1];
                   ywire =  bottom_matches_tight[imatch][2];
                   break;
                 case kUpstream:
                   uwire =  upstream_matches_tight[imatch][0];
                   vwire =  upstream_matches_tight[imatch][1];
                   ywire =  upstream_matches_tight[imatch][2];
                   break;
                 case kDownstream:
                   uwire =  downstream_matches_tight[imatch][0];
                   vwire =  downstream_matches_tight[imatch][1];
                   ywire =  downstream_matches_tight[imatch][2];
                   break;
                 default:
                   uwire = vwire = ywire = -1;
                   break;
                };
              }
              else if ( fMode==kLoose ) {
               switch (b) {
                 case kTop:
                   uwire =  top_matches_loose[imatch][0];
                   vwire =  top_matches_loose[imatch][1];
                   ywire =  top_matches_loose[imatch][2];
                   break;
                 case kBottom:
                   uwire =  bottom_matches_loose[imatch][0];
                   vwire =  bottom_matches_loose[imatch][1];
                   ywire =  bottom_matches_loose[imatch][2];
                   break;
                 case kUpstream:
                   uwire =  upstream_matches_loose[imatch][0];
                   vwire =  upstream_matches_loose[imatch][1];
                   ywire =  upstream_matches_loose[imatch][2];
                   break;
                 case kDownstream:
                   uwire =  downstream_matches_loose[imatch][0];
                   vwire =  downstream_matches_loose[imatch][1];
                   ywire =  downstream_matches_loose[imatch][2];
                   break;
                 default:
                   uwire = vwire = ywire = -1;
                   break;
                };
              }
	  };

          void getPosition( Boundary_t b, int imatch, float& x, float& y, float& z ) {
             if ( fMode==kTight ) {
               switch (b) {
                 case kTop:
                   x =  top_positions_tight[imatch][0];
                   y =  top_positions_tight[imatch][1];
                   z =  top_positions_tight[imatch][2];
                   break;
                 case kBottom:
                   x =  bottom_positions_tight[imatch][0];
                   y =  bottom_positions_tight[imatch][1];
                   z =  bottom_positions_tight[imatch][2];
                   break;
                 case kUpstream:
                   x =  upstream_positions_tight[imatch][0];
                   y =  upstream_positions_tight[imatch][1];
                   z =  upstream_positions_tight[imatch][2];
                   break;
                 case kDownstream:
                   x =  downstream_positions_tight[imatch][0];
                   y =  downstream_positions_tight[imatch][1];
                   z =  downstream_positions_tight[imatch][2];
                   break;
                 default:
                   x = y = z = -1;
                   break;
                };
              }
              else if ( fMode==kLoose ) {
               switch (b) {
                 case kTop:
                   x =  top_positions_loose[imatch][0];
                   y =  top_positions_loose[imatch][1];
                   z =  top_positions_loose[imatch][2];
                   break;
                 case kBottom:
                   x =  bottom_positions_loose[imatch][0];
                   y =  bottom_positions_loose[imatch][1];
                   z =  bottom_positions_loose[imatch][2];
                   break;
                 case kUpstream:
                   x =  upstream_positions_loose[imatch][0];
                   y =  upstream_positions_loose[imatch][1];
                   z =  upstream_positions_loose[imatch][2];
                   break;
                 case kDownstream:
                   x =  downstream_positions_loose[imatch][0];
                   y =  downstream_positions_loose[imatch][1];
                   z =  downstream_positions_loose[imatch][2];
                   break;
                 default:
                   x = y = z = -1;
                   break;
                };
              }
	  };
           
    };//end of class

